window.bookSummaryJSON = "<p><b>A side quest adventure in the best-selling world of Awaken Online! </b></p> <p>In the aftermath of Thorn's attack on the Twilight Throne, Frank is in an awkward position. Jason and Riley have outpaced him and everyone is hard at work rebuilding the Twilight Throne, establishing new towns, and trying to get their fledgling manufacturing operation off the ground. Everyone except Frank - who finds himself with no immediate task or goal. </p> <p>So Frank decides to strike off on his own. He sets his eyes on the north, heading toward the snow-capped mountains that loom over the undead kingdom's border in the hope of improving his shapeshifting abilities. </p> <p>He soon stumbles into an unexpected adventure. A journey that may unearth the secrets behind his class and finally force him to reach his true potential.</p>"; 
